var arrLeague = [36,'','','English Premier League','2025-2026','#FF3333','league_match/images/164577482086.png',38,14,'','','ENG PR','﻿There&nbsp;are&nbsp;20&nbsp;clubs&nbsp;in&nbsp;the&nbsp;Premier&nbsp;League.&nbsp;Each&nbsp;club&nbsp;plays&nbsp;the&nbsp;others&nbsp;twice,&nbsp;namely&nbsp;a&nbsp;double&nbsp;round-robin,&nbsp;once&nbsp;at&nbsp;their&nbsp;home&nbsp;stadium&nbsp;and&nbsp;once&nbsp;at&nbsp;that&nbsp;of&nbsp;their&nbsp;opponents’.&nbsp;Teams&nbsp;receive&nbsp;three&nbsp;points&nbsp;for&nbsp;a&nbsp;win&nbsp;and&nbsp;one&nbsp;point&nbsp;for&nbsp;a&nbsp;draw.&nbsp;No&nbsp;points&nbsp;are&nbsp;awarded&nbsp;for&nbsp;a&nbsp;loss.&nbsp;Teams&nbsp;are&nbsp;ranked&nbsp;by&nbsp;total&nbsp;points,&nbsp;then&nbsp;goal&nbsp;difference,&nbsp;and&nbsp;then&nbsp;goals&nbsp;scored.&nbsp;If&nbsp;still&nbsp;equal,&nbsp;teams&nbsp;are&nbsp;deemed&nbsp;to&nbsp;occupy&nbsp;the&nbsp;same&nbsp;position.&nbsp;If&nbsp;there&nbsp;is&nbsp;a&nbsp;tie&nbsp;for&nbsp;the&nbsp;championship,&nbsp;for&nbsp;promotion&nbsp;and&nbsp;relegation,&nbsp;or&nbsp;for&nbsp;qualification&nbsp;to&nbsp;other&nbsp;competitions,&nbsp;look&nbsp;at&nbsp;the&nbsp;head-to-head&nbsp;stats&nbsp;and&nbsp;away&nbsp;goals.&nbsp;If&nbsp;still&nbsp;equal,&nbsp;a&nbsp;play-off&nbsp;match&nbsp;at&nbsp;a&nbsp;neutral&nbsp;venue&nbsp;decides&nbsp;rank.&nbsp;If&nbsp;the&nbsp;winners&nbsp;of&nbsp;UEFA&nbsp;Champions&nbsp;League&nbsp;and&nbsp;UEFA&nbsp;Europa&nbsp;League&nbsp;are&nbsp;both&nbsp;Premier&nbsp;League&nbsp;teams&nbsp;and&nbsp;neither&nbsp;has&nbsp;qualified&nbsp;for&nbsp;the&nbsp;Champions&nbsp;League&nbsp;through&nbsp;the&nbsp;league,&nbsp;then&nbsp;the&nbsp;fourth-placed&nbsp;team&nbsp;in&nbsp;the&nbsp;Premier&nbsp;League&nbsp;instead&nbsp;plays&nbsp;in&nbsp;the&nbsp;Europa&nbsp;League.&nbsp;The&nbsp;last&nbsp;three&nbsp;teams&nbsp;in&nbsp;the&nbsp;league&nbsp;this&nbsp;season&nbsp;will&nbsp;be&nbsp;relegated&nbsp;to&nbsp;the&nbsp;Championship&nbsp;next&nbsp;season.','14'];
